import React from 'react';
import {Row, Col, Container, Card, ListGroup, Button, Image} from 'react-bootstrap';
import './app.css';
import './custom.scss';



class XMContact extends React.Component {
  render (){
    
    return(
      <Col className = "main-space-inner">
              <Col className='main-header'>XM Studio | Contact
              </Col>
              <Col className='main-content'>
                <Row className = 'main-content-text'>
                We are a studio that's founded on the clouds, as of now.
                 Do drop us a message or a happy phone call to schedule a meeting!
                              
                </Row>
                <Row className = 'main-content-text'>
                  <p>
                  <span className="highlight-text">Elangovan Sankaralingom</span>
                <br/>
                CHIEF ARCHITECT<br/>
                <b>Phone</b>  +91 9842144844<br/>
                <b>Mail</b>  elan@xm.studio<br/>
                </p>

                </Row>
              </Col>
          </Col>  
    );
  
}
}


export default XMContact;
